import React from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import './note.css';

class Notes extends React.Component{


    render(){
            
        return(
            <div>
                <div className="container2">
                <nav className="navbar navbar-custom">
                <a className="navbar-brand customName" href="#">Fancy Notes</a>
            <button className="btn btn-outline-success find" type="submit" data-toggle="modal" data-target="#myModal">New Note</button>
    
            
            </nav>
                </div>
            </div>
        )
    }
}

export default Notes;
